      <text id="149" justification="0" size="4" underlined="false">
        <text>Je trouve que ça laisse trop la place à l&apos;interpretation.
 
Les réseau Sociaux ne sont pas des média, 
les stories d&apos;instagram le sont,
mais ce sont aussi des vidéos
 
Youtube est un devenu un réseau social avec 
l&apos;espace communauté
 
Les consoles ne sont pas des médias, 
mais elle envoient un flux vidéo à la TV
Les consoles ont des jeux vidéos qui eux sont des média,
GTA VI sortira sur PS5, mais sur Nintendo Switch
Mario Kart est sur Nintendo Switch, pas sur PS5</text>
